import React from 'react';
import { FadeTransform } from 'react-animation-components';
import { Card, CardImg, CardImgOverlay, CardTitle, CardText, Col } from 'reactstrap';

function ProjectCard(props) {
    return (
        <Col>
            <FadeTransform
                in
                transformProps={{
                    exitTransform: 'scale(0.5) translateY(-50%)'
                }}>
                <Card>
                    <CardImg width="30%" src={props.image} alt={props.name} />
                    <CardImgOverlay>
                        <CardTitle>{props.name}</CardTitle>
                    </CardImgOverlay>
                </Card>
            </FadeTransform>
        </Col>
    );
}

export default ProjectCard;
